import React, { useContext } from 'react' 
import Calendar from 'react-calendar'

function CalendarModel({date ,handleDataChange}){
    //setClickable(true) is used to make Background div Non clickable  
    const setCliclable =  useContext(setCliclable) ;
    return(
        <div className="calendarModel">
            <Calendar value={date} onChange={(date)=>{
                setCliclable(true);
                handleDataChange(date)}}/>
        </div>
    )
}

export default CalendarModel ;
